// src/pages/Dashboard.jsx
import React from 'react';

export default function Dashboard() {
  return (
    <div style={{ padding: '2rem' }}>
      <h1>Dashboard</h1>
      <p>Mire se vini ne panelin kryesor të menaxhimit të ujit për pije.</p>
    </div>
  );
}
